  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0145947 includes physical,
  profile and underway data collected aboard the Sikuliaq during cruise SKQ201505S
  in the Bering Sea from 2015-03-19 to 2015-04-07. These data include CONDUCTIVITY,
  CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
  SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
  ADCP, CTD and GPS. These data were collected by Carin Ashjian of Woods Hole Oceanographic
  Institution, and by University of Alaska - Fairbanks as part of Ice Trials Cruise.
  The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
  of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
  the raw and automated processed data set. Post processed quality assessed data are
  not available in this accession.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
